sys_ux_client_script.script:
/**
  * @param {params} params
  * @param {api} params.api
  * @param {TransformApiHelpers} params.helpers
  */
/**
 * @param {params} params
 * @param {api} params.api
 * @param {any} params.imports
 */
function evaluateProperty({
    api
}) {
    if (api.data.evam_data_sendback_request&& api.data.evam_data_sendback_request.output) {
        var output = api.data.evam_data_sendback_request.output;
        var singlerowoutput = output.items.splice(0, 4);
        output.items = singlerowoutput;
        return output;
    } else
        return '';
}
